import React from 'react';
import { StyleSheet,View,Text,ScrollView } from 'react-native';
import { Appbar,Card, Button,Title,Paragraph  } from 'react-native-paper';

function Products() {
    return (
         <ScrollView style = {styles.background}>
          
                {/* card Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 5}} source={require('../assets/smartswitch') }  />
                 <Card.Content>
                 {/* <Title>Home Automation <span>20$</span></Title> */}
                 <Title>Switch Board</Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>
                
                {/* card2 Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 5}} source={require('../assets/keyFinder.jpg') } />
                 <Card.Content>
                 {/* <Title>Key Finder <span>2$</span></Title> */}
                 <Title>Key Finder</Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>
 
               {/* card3 Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 5}} source={require('../assets/inverter.jpg') } />
                 <Card.Content>
                 {/* <Title>Inverters <span>5$</span></Title> */}
                 <Title>Inverters</Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>

               {/* card4 Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 5}} source={require('../assets/camera.jpg') } />
                 <Card.Content>
                 {/* <Title>Survullence camera <span>10$</span></Title> */}
                 <Title>Survullence camera</Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>

               {/* card5 Starts */}
                <Card style = {styles.card}>
                 <Card.Cover style= {{borderRadius: 1}} source={require('../assets/socket.jpg') } />
                 <Card.Content>
                 {/* <Title>Bluetooth Gadgets <span>2$</span></Title> */}
                 <Title>Socket board</Title>
                 
                 </Card.Content>
                 <Card.Actions>
                 <Button mode="contained"  style = {styles.btn}>Add To Cart</Button>  
                 </Card.Actions>
                </Card>
                
         </ScrollView>
    );
}

const styles = StyleSheet.create({
     background: {
          backgroundColor: '#EEEEEE',
         
     },
     card: {
          margin:25
     },
     btn: {
          backgroundColor: '#242945',
      
     }
}

);

export default Products;
